import React from 'react';

const NewPlanPage = () => {
  return (
    <div className="min-h-screen bg-gray-50 flex items-center justify-center">
      <div className="text-center animate-fade-in-up">
        <h1 className="text-3xl font-bold text-gray-900 mb-4 animate-text-glow">Create New Plan</h1>
        <p className="text-gray-600 animate-pulse-slow">New plan creation page coming soon...</p>
      </div>
    </div>
  );
};

export default NewPlanPage;
